// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";
import "../Structs.sol";
import "./BopToken.sol";
import "../oracles/SongOracleStructs.sol";
import "../oracles/SongOracle.sol";
import "../implementations/Song.sol";


/**
 * @title Bop Generator
 * @notice definition and management of bop creation
 * @author Vijay Dhanasekaran
 */
contract BopGenerator is Ownable, Initializable {

    uint256 private constant TRAX_DECIMALS = 18;
    uint256 public waitTime = 7;

    // 1 TRAX needed for Bop creation (could be changed by owner)
    uint256 public minTraxToCreateBop = 1 * 10**TRAX_DECIMALS;
    uint256 public minBeatsToCreateBop;

    // to be checked on instantiation
    address private songOracleAddress;
    address private songAddress;
    address private songManagerAddress;
    address private stakingToken;

    mapping(bytes32 => bytes32) private _awaitingOracleRequests;
    mapping(bytes32 => uint) private _bopTimeRegister;

    event CombinedBops( uint64 indexed parentId1, uint64 indexed parentId2, bytes32 requestId);
    event CreatedBop( uint64 indexed parentId1, uint64 indexed parentId2, uint256 songId);

    constructor(){}

    function initialize(
        address _songAddress,
        address _songOracleAddress,
        address _stakingToken
    ) external initializer {
        songAddress = _songAddress;
        songOracleAddress = _songOracleAddress;
        stakingToken = _stakingToken;
    }

    function combineBops(
        uint256 inputBeats,
        uint64 parentId1,
        uint64 parentId2
      ) external onlyOwner {
        require(inputBeats >= minBeatsToCreateBop, "Insufficient beats to combine Bop");

        bytes32 key = hashKey(parentId1,parentId2);

        bytes32 requestId = SongOracle(songOracleAddress).findSong(parentId1, parentId2);
        _awaitingOracleRequests[key] = requestId;
        _bopTimeRegister[key] = block.timestamp;

        emit CombinedBops(parentId1, parentId2, requestId);
    }

    // placeholder function to createbop tokens after 7 days of breeding
    function createBop(
        uint256 inputBeats,
        uint64 parentId1,
        uint64 parentId2
      ) external onlyOwner {
      require(inputBeats > minBeatsToCreateBop, "Insufficient beats to create Bop");

      bytes32 key = hashKey(parentId1, parentId2);
      bytes32 requestId = _awaitingOracleRequests[key];

      // Wait until elapsed time to create Bop (7 days)
      uint createdTime = _bopTimeRegister[key];
      require(!isTimePassed(createdTime), "Not eligible to create Bop");

      // Get song id from oracle contract
      uint256 songId = SongOracle(songOracleAddress).getSongId(requestId);

      // Check if song already exist
      require(songId != 0, "Song does not exist");

      uint256 traxAmount = minTraxToCreateBop;

      // Mint boptoken in SongContract
      Song(songAddress).initialize(songId, "genre", songManagerAddress);
      Song(songAddress).spawnChildBop(stakingToken, parentId1, parentId2, traxAmount, inputBeats);

      delete _awaitingOracleRequests[key];
      emit CreatedBop(parentId1, parentId2, songId);
    }

    /**
     * @notice Set minimum waiting time before creating Bop(only by the owner)
     * @param _inSeconds days to needed
     */
    function setWaitTime(uint _inSeconds) external onlyOwner {
        require(_inSeconds > 0, "Wait time should be greater than zero");
        waitTime = _inSeconds;
    }

    /**
     * @notice Set minimum beats needed to combine NFTs (only by the owner)
     * @param minBeats The minimum number of beats needed
     */
    function setMinBeats(uint256 minBeats) external onlyOwner {
        require(minBeats != 0, "Beats should be greater than zero");
        minBeatsToCreateBop = minBeats;
    }

    /**
     * @notice Set minimum Trax needed to combine NFTs (only by the owner)
     * @param minTrax The minimum number of Trax needed
     */
    function setMinTrax(uint256 minTrax) external onlyOwner {
        require(minTrax != 0, "Beats should be greater than zero");
        minTraxToCreateBop = minTrax* 10**TRAX_DECIMALS;
    }

    // hash to convert ids
    function hashKey(uint256 parentId1, uint256 parentId2) internal pure returns (bytes32) {
      return keccak256(abi.encodePacked(parentId1, parentId2));
   }

   /**
    * @notice Check if the waiting time is over to create Bop
    * @param _createdTime The minimum number of beats needed
    */
   function isTimePassed(uint _createdTime) internal view returns (bool) {
       return block.timestamp > (_createdTime * waitTime);
   }
}

